import splashAnimation from "./assets/lottie/splashAnimation"; // Rename to your file name for custom animation

// Splash Screen

const splashScreen = {
  enabled: true, // set false to disable splash screen
  animation: splashAnimation,
  duration: 2000 // Set animation duration as per your animation
};

// Summary And Greeting Section

const illustration = {
  animated: true // Set to false to use static SVG
};

const greeting = {
  username: "Uzair Waheed",
  title: "Hi all, I'm Uzair",
  subTitle: emoji(
    "I am a Front-End Developer focused on building clean and user-friendly interfaces. I am passionate about producing software that makes life better for those around me."
  ),
  resumeLink:
    "https://drive.google.com/file/d/1ZMmc6Np_mtKehGbU6BNMBiR7P_FtsiNo/view?usp=sharing", // Set to empty to hide the button
  displayGreeting: true // Set false to hide this section, defaults to true
};

// Social Media Links

const socialMediaLinks = {
  github: "https://github.com/uzairwaheed1",
  linkedin: "https://www.linkedin.com/in/uzair-waheed-224a62251/",
  gmail: "uzairw227@gmail.com",
  // gitlab: "https://gitlab.com/saadpasta",
  facebook: "https://www.facebook.com/uzair.waheed.359",
  // medium: "https://medium.com/@saadpasta",
  // stackoverflow: "https://stackoverflow.com/users/10422806/saad-pasta",
