  title: "What I do",
  subTitle: "CRAZY FULL STACK DEVELOPER WHO WANTS TO EXPLORE EVERY TECH STACK",
  skills: [
    emoji(
      "‚ö° Exploring the basics of JavaScript for frontend development."
    ),
    emoji("‚ö° Diving into the world of ReactJS to build dynamic user interfaces."),
    emoji(
      "‚ö° Grasping programming with C and Java to broaden my skills."
    )
  ],

  /* Make Sure to include correct Font Awesome Classname to view your icon
https://fontawesome.com/icons?d=gallery */

