  title: "Personal Projects",
  subtitle: "",
  projects: [
    {
      image: require("./assets/images/quiz.jpg"),
      projectName: "Quiz",
      projectDesc: "This web application is developed using React.js and is designed to host quizzes on various programming languages. Users can participate in these quizzes, answer questions related to different programming languages, and upon completion, receive their quiz results.",
